        createPrefilledDataType4(dataArr, selected, def) {
            let customPrefilled = [];
            if (selected.length != 0 && selected[0] != "") {
                dataArr.forEach(el => {
                    let obj = {
                        data: el,
                        checked: selected.includes(el)
                    };
                    customPrefilled.push(obj);
                });
            }
            else {
                dataArr.forEach(el => {
                    let obj = {
                        data: el,
                        checked: def.indexOf(el) != -1
                    };
                    customPrefilled.push(obj);
                });
            }
            return customPrefilled;
        }
