        createPrefilledData(dataArr) {
            let customPrefilled = [];
            dataArr.forEach(el => {
                let obj = {
                    displayName: el.toString(),
                    data: el,
                    checked: false
                };
                customPrefilled.push(obj);
            });
            return customPrefilled;
        }
